import React, { useState } from 'react';
import styled, { keyframes } from 'styled-components';

// Keyframe animations
const fadeInUp = keyframes`
  from {
    opacity: 0;
    transform: translateY(20px);
  }
  to {
    opacity: 1;
    transform: translateY(0);
  }
`;

const slideInLeft = keyframes`
  from {
    opacity: 0;
    transform: translateX(-30px);
  }
  to {
    opacity: 1;
    transform: translateX(0);
  }
`;

const float = keyframes`
  0%, 100% {
    transform: translateY(0px);
  }
  50% {
    transform: translateY(-5px);
  }
`;

const shimmer = keyframes`
  0% {
    background-position: -200px 0;
  }
  100% {
    background-position: calc(200px + 100%) 0;
  }
`;

// Styled Components
const TeamPageContainer = styled.div`
  min-height: 100vh;
  background-color: #f8e8d8;
  position: relative;
  padding: 0;
`;

const TeamHeader = styled.header`
  text-align: center;
  padding: 80px 20px 60px;
  background-color: #f8e8d8;
`;

const MeetOurTeam = styled.h1`
  font-size: clamp(2.5rem, 6vw, 4rem);
  font-weight: 800;
  margin: 0 0 20px 0;
  line-height: 1.1;
  letter-spacing: -0.01em;
  color: #0a3b1e;
  text-align: center;
`;

const TeamDescription = styled.p`
  font-size: 1.1rem;
  color: #0a3b1e;
  line-height: 1.6;
  max-width: 600px;
  margin: 0 auto 40px;
  text-align: center;
  opacity: 0.8;
`;

const DepartmentsSection = styled.div`
  display: flex;
  flex-wrap: wrap;
  justify-content: center;
  gap: 12px;
  padding: 0 20px 50px;
  max-width: 1000px;
  margin: 0 auto;
`;

const DepartmentButton = styled.button`
  background-color: #c9b8a8;
  color: #f8e8d8;
  border: none;
  padding: 10px 20px;
  border-radius: 20px;
  font-size: 0.9rem;
  font-weight: 600;
  cursor: pointer;
  transition: all 0.3s ease;
  animation: ${fadeInUp} 0.6s ease-out ${props => props.delay}s both;

  &:hover {
    background-color: #0a3b1e;
    transform: translateY(-2px);
    box-shadow: 0 4px 12px rgba(10, 59, 30, 0.2);
  }
`;

const TeamSections = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 20px 60px;
`;

const TeamSection = styled.section`
  margin-bottom: 60px;
  animation: ${fadeInUp} 0.8s ease-out;

  &:last-child {
    margin-bottom: 0;
  }
`;

const SectionTitle = styled.h2`
  font-size: 2rem;
  font-weight: 700;
  color: #0a3b1e;
  text-align: center;
  margin-bottom: 40px;
  position: relative;

  &::after {
    content: '';
    position: absolute;
    bottom: -10px;
    left: 50%;
    transform: translateX(-50%);
    width: 60px;
    height: 3px;
    background-color: #c9b8a8;
    border-radius: 2px;
  }
`;

const MembersGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
  gap: 25px;
  justify-items: center;
`;

const MemberCard = styled.div`
  background-color: white;
  border-radius: 15px;
  padding: 25px;
  text-align: center;
  transition: all 0.3s ease;
  box-shadow: 0 4px 15px rgba(10, 59, 30, 0.1);
  animation: ${fadeInUp} 0.6s ease-out ${props => props.delay}s both;
  border: 2px solid transparent;

  &:hover {
    transform: translateY(-5px);
    box-shadow: 0 8px 25px rgba(10, 59, 30, 0.15);
    border-color: #c9b8a8;
  }
`;

const MemberImageStyled = styled.img`
  width: 120px;
  height: 120px;
  border-radius: 50%;
  object-fit: cover;
  margin-bottom: 15px;
  border: 3px solid #c9b8a8;
  transition: all 0.3s ease;

  ${MemberCard}:hover & {
    transform: scale(1.05);
    border-color: #0a3b1e;
  }
`;

const PlaceholderImage = styled.div`
  width: 120px;
  height: 120px;
  background-color: #f0f0f0;
  display: flex;
  align-items: center;
  justify-content: center;
  color: #666;
  font-size: 12px;
  text-align: center;
  border-radius: 50%;
  margin: 0 auto 15px;
  border: 3px solid #c9b8a8;
  position: relative;
  overflow: hidden;

  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: -200px;
    width: 200px;
    height: 100%;
    background: linear-gradient(90deg, transparent, rgba(255, 255, 255, 0.4), transparent);
    animation: ${shimmer} 2s infinite;
  }
`;

const PlaceholderText = styled.span`
  position: relative;
  z-index: 1;
  font-weight: 500;
`;

const MemberName = styled.h3`
  font-size: 1.2rem;
  font-weight: 700;
  color: #0a3b1e;
  margin: 0 0 5px 0;
  text-align: center;
`;

const MemberRole = styled.p`
  font-size: 0.95rem;
  color: #c9b8a8;
  margin: 0;
  font-weight: 500;
  text-align: center;
`;

// Component for rendering member images
const MemberImage = ({ name }) => {
  const imageName = name.replace(/\s/g, '') + '.jpg';
  const imagePath = `/images/${imageName}`;

  return (
    <MemberImageStyled 
      src={imagePath} 
      alt={name}
      onError={(e) => {
        e.target.style.display = 'none';
        e.target.nextSibling.style.display = 'flex';
      }}
    />
  );
};

