    ],
    design: [
      { id: 'design1', name: 'Sanjay Krishnan', role: 'Head' },
      { id: 'design2', name: 'Sanjay Krishnan', role: 'Head' }
    ],
    tech: [
      { id: 'tech1', name: 'C.S Abhinav', role: 'Head' },
      { id: 'tech2', name: 'Sanjay Krishnan', role: 'Head' }
    ]
  };

  const filteredMembers = selectedDepartment === 'all' 
    ? Object.entries(teamMembers).reduce((acc, [dept, members]) => {
        acc[dept] = members;
        return acc;
      }, {})
    : { [selectedDepartment]: teamMembers[selectedDepartment] || [] };

  return (
    <TeamPageContainer>
      <TeamHeader>
        <MeetOurTeam>Meet Our Team</MeetOurTeam>
        <TeamDescription>
          Passionate individuals working together to create literary excellence and foster a vibrant community of readers and writers.
        </TeamDescription>

        <DepartmentsSection>
          {departments.map((dept, index) => (
            <DepartmentButton
              key={dept.id}
              color={dept.color}
              delay={index * 0.1}
              onClick={() => setSelectedDepartment(dept.id)}
              style={{
                backgroundColor: selectedDepartment === dept.id ? '#0a3b1e' : '#c9b8a8'
              }}
            >
              {dept.name}
            </DepartmentButton>
          ))}
        </DepartmentsSection>
      </TeamHeader>

      <TeamSections>
        {Object.entries(filteredMembers).map(([department, members]) => (
          <TeamSection key={department}>
            <SectionTitle>
              {department.charAt(0).toUpperCase() + department.slice(1)} Team
            </SectionTitle>
            <MembersGrid>
              {members.map((member, index) => (
                <MemberCard key={member.id} delay={index * 0.1}>
                  <MemberImage name={member.name} />
                  <PlaceholderImage style={{ display: 'none' }}>
                    <PlaceholderText>Photo Coming Soon</PlaceholderText>
                  </PlaceholderImage>
                  <MemberName>{member.name}</MemberName>
                  <MemberRole>{member.role}</MemberRole>
                </MemberCard>
              ))}
            </MembersGrid>
          </TeamSection>
        ))}
      </TeamSections>
    </TeamPageContainer>
  );
};

export default TeamPage;
